    protected function authenticateByService($token)
    {
        $response = self::AVAILABLE_USER;
        if (!array_key_exists($token, $response)) {
            $this->logger->error('Test authenticate failed, token "'.$token.'" not found');

            return false;
        }

        $this->logger->debug('Test authenticate okay, result:'.$response[$token]);

        return $response[$token];
    }
